// components/CustomModal.jsx
import {
    Dialog,
    DialogTitle,
    DialogContent,
    DialogActions,
    Button
} from '@mui/material';

const InventoryModal = ({ isOpen, onClose }) => {
    return (
        <Dialog open={isOpen} maxWidth="sm" fullWidth>
            <DialogTitle>Save Inventory</DialogTitle>
            <DialogContent dividers>
                <div>Form</div>
            </DialogContent>
            <DialogActions>
                <Button onClick={onClose}>cancel</Button>
            </DialogActions>
        </Dialog>
    );
};

export default InventoryModal;
